import React from "react";
import Castle from './castle.jpg';  // 이미지 import
import './css/castle.css';         // CSS 파일 import

function HomePage() {
    return (
        <div>
            {/* 배너 이미지 */}
            <div className="castle">
                <img src={Castle} alt="Castle" />
            </div>
            <h1>Welcome to the Castle</h1>  {/* 제목은 이미지 아래에 배치 */}
        </div>
    );
}

export default HomePage;
